        :: Python :: 3.8","Programming Language :: Python :: 3.9"],"description":"Certifi:
        Python SSL Certificates\n================================\n\nCertifi provides
        Mozilla''s carefully curated collection of Root Certificates for\nvalidating
        the trustworthiness of SSL certificates while verifying the identity\nof TLS
        hosts. It has been extracted from the `Requests`_ project.\n\nInstallation\n------------\n\n``certifi``
        is available on PyPI. Simply install it with ``pip``::\n\n    $ pip install
        certifi\n\nUsage\n-----\n\nTo reference the installed certificate authority
        (CA) bundle, you can use the\nbuilt-in function::\n\n    >>> import certifi\n\n    >>>
        certifi.where()\n    ''/usr/local/lib/python3.7/site-packages/certifi/cacert.pem''\n\nOr
        from the command line::\n\n    $ python -m certifi\n    /usr/local/lib/python3.7/site-packages/certifi/cacert.pem\n\nEnjoy!\n\n..
        _`Requests`: https://requests.readthedocs.io/en/master/\n\nAddition/Removal
        of Certificates\n--------------------------------\n\nCertifi does not support
        any addition/removal or other modification of the\nCA trust store content.
