        /></a>\\n  <a href=\\\"https://bestpractices.coreinfrastructure.org/projects/6227\\\"><img
        alt=\\\"CII Best Practices\\\" src=\\\"https://bestpractices.coreinfrastructure.org/projects/6227/badge\\\"
        /></a>\\n</p>\\n\\nurllib3 is a powerful, *user-friendly* HTTP client for
        Python. Much of the\\nPython ecosystem already uses urllib3 and you should
        too.\\nurllib3 brings many critical features that are missing from the Python\\nstandard
        libraries:\\n\\n- Thread safety.\\n- Connection pooling.\\n- Client-side SSL/TLS
        verification.\\n- File uploads with multipart encoding.\\n- Helpers for retrying
        requests and dealing with HTTP redirects.\\n- Support for gzip, deflate, brotli,
        and zstd encoding.\\n- Proxy support for HTTP and SOCKS.\\n- 100% test coverage.\\n\\nurllib3
        is powerful and easy to use:\\n\\n```python3\\n>>> import urllib3\\n>>> resp
        = urllib3.request(\\\"GET\\\", \\\"http://httpbin.org/robots.txt\\\")\\n>>>
        resp.status\\n200\\n>>> resp.data\\nb\\\"User-agent: *\\\\nDisallow: /deny\\\\n\\\"\\n```\\n\\n##
        Installing\\n\\nurllib3 can be installed with [pip](https://pip.pypa.io):\\n\\n```bash\\n$
        python -m pip install urllib3\\n```\\n\\nAlternatively, you can grab the latest
        source code from [GitHub](https://github.com/urllib3/urllib3):\\n\\n```bash\\n$
        git clone https://github.com/urllib3/urllib3.git\\n$ cd urllib3\\n$ pip install
        .\\n```\\n\\n\\n## Documentation\\n\\nurllib3 has usage and reference documentation
        at [urllib3.readthedocs.io](https://urllib3.readthedocs.io).\\n\\n\\n## Community\\n\\nurllib3
        has a [community Discord channel](https://discord.gg/urllib3) for asking questions
        and\\ncollaborating with other contributors. Drop by and say hello \U0001F44B\\n\\n\\n##
        Contributing\\n\\nurllib3 happily accepts contributions. Please see our\\n[contributing
        documentation](https://urllib3.readthedocs.io/en/latest/contributing.html)\\nfor
        some tips on getting started.\\n\\n\\n## Security Disclosures\\n\\nTo report
