      string: "{\"info\":{\"author\":null,\"author_email\":\"\\\"Ahmed R. TAHRI\\\"
        <tahri.ahmed@proton.me>\",\"bugtrack_url\":null,\"classifiers\":[\"Development
        Status :: 5 - Production/Stable\",\"Intended Audience :: Developers\",\"License
        :: OSI Approved :: MIT License\",\"Operating System :: OS Independent\",\"Programming
        Language :: Python\",\"Programming Language :: Python :: 3\",\"Programming
        Language :: Python :: 3 :: Only\",\"Programming Language :: Python :: 3.10\",\"Programming
        Language :: Python :: 3.11\",\"Programming Language :: Python :: 3.12\",\"Programming
