        Language :: Python :: 3.8\",\"Programming Language :: Python :: 3.9\",\"Programming
        Language :: Python :: Implementation :: CPython\",\"Programming Language ::
        Python :: Implementation :: PyPy\",\"Topic :: Text Processing :: Linguistic\",\"Topic
        :: Utilities\",\"Typing :: Typed\"],\"description\":\"<h1 align=\\\"center\\\">Charset
        Detection, for Everyone \U0001F44B</h1>\\n\\n<p align=\\\"center\\\">\\n  <sup>The
        Real First Universal Charset Detector</sup><br>\\n  <a href=\\\"https://pypi.org/project/charset-normalizer\\\">\\n
