        />\\n  </a>\\n  <a href=\\\"https://bestpractices.coreinfrastructure.org/projects/7297\\\">\\n
        \   <img src=\\\"https://bestpractices.coreinfrastructure.org/projects/7297/badge\\\">\\n
        \ </a>\\n</p>\\n<p align=\\\"center\\\">\\n  <sup><i>Featured Packages</i></sup><br>\\n
        \ <a href=\\\"https://github.com/jawah/niquests\\\">\\n   <img alt=\\\"Static
        Badge\\\" src=\\\"https://img.shields.io/badge/Niquests-Best_HTTP_Client-cyan\\\">\\n
        \ </a>\\n  <a href=\\\"https://github.com/jawah/wassima\\\">\\n   <img alt=\\\"Static
        Badge\\\" src=\\\"https://img.shields.io/badge/Wassima-Certifi_Killer-cyan\\\">\\n
        \ </a>\\n</p>\\n<p align=\\\"center\\\">\\n  <sup><i>In other language (unofficial
        port - by the community)</i></sup><br>\\n  <a href=\\\"https://github.com/nickspring/charset-normalizer-rs\\\">\\n
        \  <img alt=\\\"Static Badge\\\" src=\\\"https://img.shields.io/badge/Rust-red\\\">\\n
        \ </a>\\n</p>\\n\\n> A library that helps you read text from an unknown charset
        encoding.<br /> Motivated by `chardet`,\\n> I'm trying to resolve the issue
        by taking a new approach.\\n> All IANA character set names for which the Python
        core library provides codecs are supported.\\n\\n<p align=\\\"center\\\">\\n
        \ >>>>> <a href=\\\"https://charsetnormalizerweb.ousret.now.sh\\\" target=\\\"_blank\\\">\U0001F449
        Try Me Online Now, Then Adopt Me \U0001F448 </a> <<<<<\\n</p>\\n\\nThis project
        offers you an alternative to **Universal Charset Encoding Detector**, also
        known as **Chardet**.\\n\\n| Feature                                          |
        [Chardet](https://github.com/chardet/chardet) |                                         Charset
        Normalizer                                         | [cChardet](https://github.com/PyYoshi/cChardet)
        |\\n|--------------------------------------------------|:---------------------------------------------:|:--------------------------------------------------------------------------------------------------:|:-----------------------------------------------:|\\n|
        `Fast`                                           |                       \u274C
        \                      |                                                 \u2705
        \                                                 |                        \u2705
        \                       |\\n| `Universal**`                                    |
        \                      \u274C                       |                                                 \u2705
        \                                                 |                        \u274C
        \                       |\\n| `Reliable` **without** distinguishable standards
        |                       \u274C                       |                                                 \u2705
        \                                                 |                        \u2705
        \                       |\\n| `Reliable` **with** distinguishable standards
        \   |                       \u2705                       |                                                 \u2705
        \                                                 |                        \u2705
        \                       |\\n| `License`                                        |
        \          LGPL-2.1<br>_restrictive_           |                                                MIT
        \                                                |            MPL-1.1<br>_restrictive_
        \            |\\n| `Native Python`                                  |                       \u2705
        \                      |                                                 \u2705
        \                                                 |                        \u274C
        \                       |\\n| `Detect spoken language`                         |
        \                      \u274C                       |                                                 \u2705
        \                                                 |                       N/A
        \                      |\\n| `UnicodeDecodeError Safety`                      |
        \                      \u274C                       |                                                 \u2705
        \                                                 |                        \u274C
        \                       |\\n| `Whl Size (min)`                                 |
        \                  193.6 kB                    |                                               42
        kB                                                |                     ~200
        kB                     |\\n| `Supported Encoding`                             |
        \                     33                       | \U0001F389 [99](https://charset-normalizer.readthedocs.io/en/latest/user/support.html#supported-encodings)
        |                       40                        |\\n\\n<p align=\\\"center\\\">\\n<img
        src=\\\"https://i.imgflip.com/373iay.gif\\\" alt=\\\"Reading Normalized Text\\\"
        width=\\\"226\\\"/><img src=\\\"https://media.tenor.com/images/c0180f70732a18b4965448d33adba3d0/tenor.gif\\\"
        alt=\\\"Cat Reading Text\\\" width=\\\"200\\\"/>\\n</p>\\n\\n*\\\\*\\\\* :
        They are clearly using specific code for a specific encoding even if covering
        most of used one*<br>\\n\\n## \u26A1 Performance\\n\\nThis package offer better
        performance than its counterpart Chardet. Here are some numbers.\\n\\n| Package
        \                                      | Accuracy | Mean per file (ms) | File
        per sec (est) |\\n|-----------------------------------------------|:--------:|:------------------:|:------------------:|\\n|
        [chardet](https://github.com/chardet/chardet) |   86 %   |       63 ms        |
        \   16 file/sec     |\\n| charset-normalizer                            |
        **98 %** |     **10 ms**      |    100 file/sec    |\\n\\n| Package                                       |
        99th percentile | 95th percentile | 50th percentile |\\n|-----------------------------------------------|:---------------:|:---------------:|:---------------:|\\n|
        [chardet](https://github.com/chardet/chardet) |     265 ms      |      71
        ms      |      7 ms       |\\n| charset-normalizer                            |
        \    100 ms      |      50 ms      |      5 ms       |\\n\\n_updated as of
        december 2024 using CPython 3.12_\\n\\nChardet's performance on larger file
        (1MB+) are very poor. Expect huge difference on large payload.\\n\\n> Stats
        are generated using 400+ files using default parameters. More details on used
        files, see GHA workflows.\\n> And yes, these results might change at any time.
        The dataset can be updated to include more files.\\n> The actual delays heavily
        depends on your CPU capabilities. The factors should remain the same.\\n>
        Keep in mind that the stats are generous and that Chardet accuracy vs our
        is measured using Chardet initial capability\\n> (e.g. Supported Encoding)
        Challenge-them if you want.\\n\\n## \u2728 Installation\\n\\nUsing pip:\\n\\n```sh\\npip
        install charset-normalizer -U\\n```\\n\\n## \U0001F680 Basic Usage\\n\\n###
        CLI\\nThis package comes with a CLI.\\n\\n```\\nusage: normalizer [-h] [-v]
        [-a] [-n] [-m] [-r] [-f] [-t THRESHOLD]\\n                  file [file ...]\\n\\nThe
        Real First Universal Charset Detector. Discover originating encoding used\\non
        text file. Normalize text to unicode.\\n\\npositional arguments:\\n  files
        \                File(s) to be analysed\\n\\noptional arguments:\\n  -h, --help
        \           show this help message and exit\\n  -v, --verbose         Display
        complementary information about file if any.\\n                        Stdout
        will contain logs about the detection process.\\n  -a, --with-alternative\\n
        \                       Output complementary possibilities if any. Top-level\\n
        \                       JSON WILL be a list.\\n  -n, --normalize       Permit
        to normalize input file. If not set, program\\n                        does
        not write anything.\\n  -m, --minimal         Only output the charset detected
        to STDOUT. Disabling\\n                        JSON output.\\n  -r, --replace
        \        Replace file when trying to normalize it instead of\\n                        creating
        a new one.\\n  -f, --force           Replace file without asking if you are
        sure, use this\\n                        flag with caution.\\n  -t THRESHOLD,
        --threshold THRESHOLD\\n                        Define a custom maximum amount
        of chaos allowed in\\n                        decoded content. 0. <= chaos
        <= 1.\\n  --version             Show version information and exit.\\n```\\n\\n```bash\\nnormalizer
        ./data/sample.1.fr.srt\\n```\\n\\nor\\n\\n```bash\\npython -m charset_normalizer
        ./data/sample.1.fr.srt\\n```\\n\\n\U0001F389 Since version 1.4.0 the CLI produce
        easily usable stdout result in JSON format.\\n\\n```json\\n{\\n    \\\"path\\\":
        \\\"/home/default/projects/charset_normalizer/data/sample.1.fr.srt\\\",\\n
        \   \\\"encoding\\\": \\\"cp1252\\\",\\n    \\\"encoding_aliases\\\": [\\n
        \       \\\"1252\\\",\\n        \\\"windows_1252\\\"\\n    ],\\n    \\\"alternative_encodings\\\":
        [\\n        \\\"cp1254\\\",\\n        \\\"cp1256\\\",\\n        \\\"cp1258\\\",\\n
        \       \\\"iso8859_14\\\",\\n        \\\"iso8859_15\\\",\\n        \\\"iso8859_16\\\",\\n
        \       \\\"iso8859_3\\\",\\n        \\\"iso8859_9\\\",\\n        \\\"latin_1\\\",\\n
        \       \\\"mbcs\\\"\\n    ],\\n    \\\"language\\\": \\\"French\\\",\\n    \\\"alphabets\\\":
        [\\n        \\\"Basic Latin\\\",\\n        \\\"Latin-1 Supplement\\\"\\n    ],\\n
        \   \\\"has_sig_or_bom\\\": false,\\n    \\\"chaos\\\": 0.149,\\n    \\\"coherence\\\":
        97.152,\\n    \\\"unicode_path\\\": null,\\n    \\\"is_preferred\\\": true\\n}\\n```\\n\\n###
        Python\\n*Just print out normalized text*\\n```python\\nfrom charset_normalizer
        import from_path\\n\\nresults = from_path('./my_subtitle.srt')\\n\\nprint(str(results.best()))\\n```\\n\\n*Upgrade
        your code without effort*\\n```python\\nfrom charset_normalizer import detect\\n```\\n\\nThe
        above code will behave the same as **chardet**. We ensure that we offer the
        best (reasonable) BC result possible.\\n\\nSee the docs for advanced usage
        : [readthedocs.io](https://charset-normalizer.readthedocs.io/en/latest/)\\n\\n##
        \U0001F607 Why\\n\\nWhen I started using Chardet, I noticed that it was not
        suited to my expectations, and I wanted to propose a\\nreliable alternative
        using a completely different method. Also! I never back down on a good challenge!\\n\\nI
        **don't care** about the **originating charset** encoding, because **two different
        tables** can\\nproduce **two identical rendered string.**\\nWhat I want is
        to get readable text, the best I can.\\n\\nIn a way, **I'm brute forcing text
        decoding.** How cool is that ? \U0001F60E\\n\\nDon't confuse package **ftfy**
        with charset-normalizer or chardet. ftfy goal is to repair Unicode string
        whereas charset-normalizer to convert raw file in unknown encoding to unicode.\\n\\n##
        \U0001F370 How\\n\\n  - Discard all charset encoding table that could not
        fit the binary content.\\n  - Measure noise, or the mess once opened (by chunks)
        with a corresponding charset encoding.\\n  - Extract matches with the lowest
        mess detected.\\n  - Additionally, we measure coherence / probe for a language.\\n\\n**Wait
        a minute**, what is noise/mess and coherence according to **YOU ?**\\n\\n*Noise
        :* I opened hundred of text files, **written by humans**, with the wrong encoding
        table. **I observed**, then\\n**I established** some ground rules about **what
        is obvious** when **it seems like** a mess (aka. defining noise in rendered
        text).\\n I know that my interpretation of what is noise is probably incomplete,
        feel free to contribute in order to\\n improve or rewrite it.\\n\\n*Coherence
        :* For each language there is on earth, we have computed ranked letter appearance
        occurrences (the best we can). So I thought\\nthat intel is worth something
        here. So I use those records against decoded text to check if I can detect
        intelligent design.\\n\\n## \u26A1 Known limitations\\n\\n  - Language detection
        is unreliable when text contains two or more languages sharing identical letters.
        (eg. HTML (english tags) + Turkish content (Sharing Latin characters))\\n
        \ - Every charset detector heavily depends on sufficient content. In common
        cases, do not bother run detection on very tiny content.\\n\\n## \u26A0\uFE0F
        About Python EOLs\\n\\n**If you are running:**\\n\\n- Python >=2.7,<3.5: Unsupported\\n-
        Python 3.5: charset-normalizer < 2.1\\n- Python 3.6: charset-normalizer <
        3.1\\n- Python 3.7: charset-normalizer < 4.0\\n\\nUpgrade your Python interpreter
        as soon as possible.\\n\\n## \U0001F464 Contributing\\n\\nContributions, issues
        and feature requests are very much welcome.<br />\\nFeel free to check [issues
        page](https://github.com/ousret/charset_normalizer/issues) if you want to
        contribute.\\n\\n## \U0001F4DD License\\n\\nCopyright \xA9 [Ahmed TAHRI @Ousret](https://github.com/Ousret).<br
        />\\nThis project is [MIT](https://github.com/Ousret/charset_normalizer/blob/master/LICENSE)
        licensed.\\n\\nCharacters frequencies used in this project \xA9 2012 [Denny
        Vrande\u010Di\u0107](http://simia.net/letters/)\\n\\n## \U0001F4BC For Enterprise\\n\\nProfessional
        support for charset-normalizer is available as part of the [Tidelift\\nSubscription][1].
        Tidelift gives software development teams a single source for\\npurchasing
        and maintaining their software, with professional grade assurances\\nfrom
        the experts who know it best, while seamlessly integrating with existing\\ntools.\\n\\n[1]:
        https://tidelift.com/subscription/pkg/pypi-charset-normalizer?utm_source=pypi-charset-normalizer&utm_medium=readme\\n\\n[![OpenSSF
        Best Practices](https://www.bestpractices.dev/projects/7297/badge)](https://www.bestpractices.dev/projects/7297)\\n\\n#
        Changelog\\nAll notable changes to charset-normalizer will be documented in
        this file. This project adheres to [Semantic Versioning](https://semver.org/spec/v2.0.0.html).\\nThe
        format is based on [Keep a Changelog](https://keepachangelog.com/en/1.0.0/).\\n\\n##
        [3.4.1](https://github.com/Ousret/charset_normalizer/compare/3.4.0...3.4.1)
        (2024-12-24)\\n\\n### Changed\\n- Project metadata are now stored using `pyproject.toml`
        instead of `setup.cfg` using setuptools as the build backend.\\n- Enforce
        annotation delayed loading for a simpler and consistent types in the project.\\n-
        Optional mypyc compilation upgraded to version 1.14 for Python >= 3.8\\n\\n###
        Added\\n- pre-commit configuration.\\n- noxfile.\\n\\n### Removed\\n- `build-requirements.txt`
        as per using `pyproject.toml` native build configuration.\\n- `bin/integration.py`
        and `bin/serve.py` in favor of downstream integration test (see noxfile).\\n-
        `setup.cfg` in favor of `pyproject.toml` metadata configuration.\\n- Unused
        `utils.range_scan` function.\\n\\n### Fixed\\n- Converting content to Unicode
        bytes may insert `utf_8` instead of preferred `utf-8`. (#572)\\n- Deprecation
        warning \\\"'count' is passed as positional argument\\\" when converting to
        Unicode bytes on Python 3.13+\\n\\n## [3.4.0](https://github.com/Ousret/charset_normalizer/compare/3.3.2...3.4.0)
        (2024-10-08)\\n\\n### Added\\n- Argument `--no-preemptive` in the CLI to prevent
        the detector to search for hints.\\n- Support for Python 3.13 (#512)\\n\\n###
        Fixed\\n- Relax the TypeError exception thrown when trying to compare a CharsetMatch
        with anything else than a CharsetMatch.\\n- Improved the general reliability
        of the detector based on user feedbacks. (#520) (#509) (#498) (#407) (#537)\\n-
        Declared charset in content (preemptive detection) not changed when converting
        to utf-8 bytes. (#381)\\n\\n## [3.3.2](https://github.com/Ousret/charset_normalizer/compare/3.3.1...3.3.2)
        (2023-10-31)\\n\\n### Fixed\\n- Unintentional memory usage regression when
        using large payload that match several encoding (#376)\\n- Regression on some
        detection case showcased in the documentation (#371)\\n\\n### Added\\n- Noise
        (md) probe that identify malformed arabic representation due to the presence
        of letters in isolated form (credit to my wife)\\n\\n## [3.3.1](https://github.com/Ousret/charset_normalizer/compare/3.3.0...3.3.1)
        (2023-10-22)\\n\\n### Changed\\n- Optional mypyc compilation upgraded to version
        1.6.1 for Python >= 3.8\\n- Improved the general detection reliability based
        on reports from the community\\n\\n## [3.3.0](https://github.com/Ousret/charset_normalizer/compare/3.2.0...3.3.0)
        (2023-09-30)\\n\\n### Added\\n- Allow to execute the CLI (e.g. normalizer)
        through `python -m charset_normalizer.cli` or `python -m charset_normalizer`\\n-
        Support for 9 forgotten encoding that are supported by Python but unlisted
        in `encoding.aliases` as they have no alias (#323)\\n\\n### Removed\\n- (internal)
        Redundant utils.is_ascii function and unused function is_private_use_only\\n-
        (internal) charset_normalizer.assets is moved inside charset_normalizer.constant\\n\\n###
        Changed\\n- (internal) Unicode code blocks in constants are updated using
        the latest v15.0.0 definition to improve detection\\n- Optional mypyc compilation
        upgraded to version 1.5.1 for Python >= 3.8\\n\\n### Fixed\\n- Unable to properly
        sort CharsetMatch when both chaos/noise and coherence were close due to an
        unreachable condition in \\\\_\\\\_lt\\\\_\\\\_ (#350)\\n\\n## [3.2.0](https://github.com/Ousret/charset_normalizer/compare/3.1.0...3.2.0)
        (2023-06-07)\\n\\n### Changed\\n- Typehint for function `from_path` no longer
        enforce `PathLike` as its first argument\\n- Minor improvement over the global
        detection reliability\\n\\n### Added\\n- Introduce function `is_binary` that
        relies on main capabilities, and optimized to detect binaries\\n- Propagate
        `enable_fallback` argument throughout `from_bytes`, `from_path`, and `from_fp`
        that allow a deeper control over the detection (default True)\\n- Explicit
        support for Python 3.12\\n\\n### Fixed\\n- Edge case detection failure where
        a file would contain 'very-long' camel cased word (Issue #289)\\n\\n## [3.1.0](https://github.com/Ousret/charset_normalizer/compare/3.0.1...3.1.0)
        (2023-03-06)\\n\\n### Added\\n- Argument `should_rename_legacy` for legacy
        function `detect` and disregard any new arguments without errors (PR #262)\\n\\n###
        Removed\\n- Support for Python 3.6 (PR #260)\\n\\n### Changed\\n- Optional
        speedup provided by mypy/c 1.0.1\\n\\n## [3.0.1](https://github.com/Ousret/charset_normalizer/compare/3.0.0...3.0.1)
        (2022-11-18)\\n\\n### Fixed\\n- Multi-bytes cutter/chunk generator did not
        always cut correctly (PR #233)\\n\\n### Changed\\n- Speedup provided by mypy/c
        0.990 on Python >= 3.7\\n\\n## [3.0.0](https://github.com/Ousret/charset_normalizer/compare/2.1.1...3.0.0)
        (2022-10-20)\\n\\n### Added\\n- Extend the capability of explain=True when
        cp_isolation contains at most two entries (min one), will log in details of
        the Mess-detector results\\n- Support for alternative language frequency set
        in charset_normalizer.assets.FREQUENCIES\\n- Add parameter `language_threshold`
        in `from_bytes`, `from_path` and `from_fp` to adjust the minimum expected
        coherence ratio\\n- `normalizer --version` now specify if current version
        provide extra speedup (meaning mypyc compilation whl)\\n\\n### Changed\\n-
        Build with static metadata using 'build' frontend\\n- Make the language detection
        stricter\\n- Optional: Module `md.py` can be compiled using Mypyc to provide
        an extra speedup up to 4x faster than v2.1\\n\\n### Fixed\\n- CLI with opt
        --normalize fail when using full path for files\\n- TooManyAccentuatedPlugin
        induce false positive on the mess detection when too few alpha character have
        been fed to it\\n- Sphinx warnings when generating the documentation\\n\\n###
        Removed\\n- Coherence detector no longer return 'Simple English' instead return
        'English'\\n- Coherence detector no longer return 'Classical Chinese' instead
        return 'Chinese'\\n- Breaking: Method `first()` and `best()` from CharsetMatch\\n-
        UTF-7 will no longer appear as \\\"detected\\\" without a recognized SIG/mark
        (is unreliable/conflict with ASCII)\\n- Breaking: Class aliases CharsetDetector,
        CharsetDoctor, CharsetNormalizerMatch and CharsetNormalizerMatches\\n- Breaking:
        Top-level function `normalize`\\n- Breaking: Properties `chaos_secondary_pass`,
        `coherence_non_latin` and `w_counter` from CharsetMatch\\n- Support for the
        backport `unicodedata2`\\n\\n## [3.0.0rc1](https://github.com/Ousret/charset_normalizer/compare/3.0.0b2...3.0.0rc1)
        (2022-10-18)\\n\\n### Added\\n- Extend the capability of explain=True when
        cp_isolation contains at most two entries (min one), will log in details of
        the Mess-detector results\\n- Support for alternative language frequency set
        in charset_normalizer.assets.FREQUENCIES\\n- Add parameter `language_threshold`
        in `from_bytes`, `from_path` and `from_fp` to adjust the minimum expected
