        frontend\\n- Make the language detection stricter\\n\\n### Fixed\\n- CLI with
        opt --normalize fail when using full path for files\\n- TooManyAccentuatedPlugin
        induce false positive on the mess detection when too few alpha character have
        been fed to it\\n\\n### Removed\\n- Coherence detector no longer return 'Simple
        English' instead return 'English'\\n- Coherence detector no longer return
        'Classical Chinese' instead return 'Chinese'\\n\\n## [3.0.0b2](https://github.com/Ousret/charset_normalizer/compare/3.0.0b1...3.0.0b2)
        (2022-08-21)\\n\\n### Added\\n- `normalizer --version` now specify if current
        version provide extra speedup (meaning mypyc compilation whl)\\n\\n### Removed\\n-
        Breaking: Method `first()` and `best()` from CharsetMatch\\n- UTF-7 will no
        longer appear as \\\"detected\\\" without a recognized SIG/mark (is unreliable/conflict
        with ASCII)\\n\\n### Fixed\\n- Sphinx warnings when generating the documentation\\n\\n##
        [3.0.0b1](https://github.com/Ousret/charset_normalizer/compare/2.1.0...3.0.0b1)
        (2022-08-15)\\n\\n### Changed\\n- Optional: Module `md.py` can be compiled
        using Mypyc to provide an extra speedup up to 4x faster than v2.1\\n\\n###
        Removed\\n- Breaking: Class aliases CharsetDetector, CharsetDoctor, CharsetNormalizerMatch
