        Breaking: Properties `chaos_secondary_pass`, `coherence_non_latin` and `w_counter`
        from CharsetMatch\\n- Support for the backport `unicodedata2`\\n\\n## [2.1.1](https://github.com/Ousret/charset_normalizer/compare/2.1.0...2.1.1)
        (2022-08-19)\\n\\n### Deprecated\\n- Function `normalize` scheduled for removal
        in 3.0\\n\\n### Changed\\n- Removed useless call to decode in fn is_unprintable
        (#206)\\n\\n### Fixed\\n- Third-party library (i18n xgettext) crashing not
        recognizing utf_8 (PEP 263) with underscore from [@aleksandernovikov](https://github.com/aleksandernovikov)
        (#204)\\n\\n## [2.1.0](https://github.com/Ousret/charset_normalizer/compare/2.0.12...2.1.0)
        (2022-06-19)\\n\\n### Added\\n- Output the Unicode table version when running
        the CLI with `--version` (PR #194)\\n\\n### Changed\\n- Re-use decoded buffer
        for single byte character sets from [@nijel](https://github.com/nijel) (PR
        #175)\\n- Fixing some performance bottlenecks from [@deedy5](https://github.com/deedy5)
        (PR #183)\\n\\n### Fixed\\n- Workaround potential bug in cpython with Zero
        Width No-Break Space located in Arabic Presentation Forms-B, Unicode 1.1 not
        acknowledged as space (PR #175)\\n- CLI default threshold aligned with the
        API threshold from [@oleksandr-kuzmenko](https://github.com/oleksandr-kuzmenko)
        (PR #181)\\n\\n### Removed\\n- Support for Python 3.5 (PR #192)\\n\\n### Deprecated\\n-
        Use of backport unicodedata from `unicodedata2` as Python is quickly catching
        up, scheduled for removal in 3.0 (PR #194)\\n\\n## [2.0.12](https://github.com/Ousret/charset_normalizer/compare/2.0.11...2.0.12)
        (2022-02-12)\\n\\n### Fixed\\n- ASCII miss-detection on rare cases (PR #170)\\n\\n##
        [2.0.11](https://github.com/Ousret/charset_normalizer/compare/2.0.10...2.0.11)
        (2022-01-30)\\n\\n### Added\\n- Explicit support for Python 3.11 (PR #164)\\n\\n###
        Changed\\n- The logging behavior have been completely reviewed, now using
        only TRACE and DEBUG levels (PR #163 #165)\\n\\n## [2.0.10](https://github.com/Ousret/charset_normalizer/compare/2.0.9...2.0.10)
        (2022-01-04)\\n\\n### Fixed\\n- Fallback match entries might lead to UnicodeDecodeError
        for large bytes sequence (PR #154)\\n\\n### Changed\\n- Skipping the language-detection
        (CD) on ASCII (PR #155)\\n\\n## [2.0.9](https://github.com/Ousret/charset_normalizer/compare/2.0.8...2.0.9)
        (2021-12-03)\\n\\n### Changed\\n- Moderating the logging impact (since 2.0.8)
        for specific environments (PR #147)\\n\\n### Fixed\\n- Wrong logging level
        applied when setting kwarg `explain` to True (PR #146)\\n\\n## [2.0.8](https://github.com/Ousret/charset_normalizer/compare/2.0.7...2.0.8)
        (2021-11-24)\\n### Changed\\n- Improvement over Vietnamese detection (PR #126)\\n-
        MD improvement on trailing data and long foreign (non-pure latin) data (PR
        #124)\\n- Efficiency improvements in cd/alphabet_languages from [@adbar](https://github.com/adbar)
        (PR #122)\\n- call sum() without an intermediary list following PEP 289 recommendations
        from [@adbar](https://github.com/adbar) (PR #129)\\n- Code style as refactored
        by Sourcery-AI (PR #131)\\n- Minor adjustment on the MD around european words
        (PR #133)\\n- Remove and replace SRTs from assets / tests (PR #139)\\n- Initialize
        the library logger with a `NullHandler` by default from [@nmaynes](https://github.com/nmaynes)
        (PR #135)\\n- Setting kwarg `explain` to True will add provisionally (bounded
        to function lifespan) a specific stream handler (PR #135)\\n\\n### Fixed\\n-
        Fix large (misleading) sequence giving UnicodeDecodeError (PR #137)\\n- Avoid
        using too insignificant chunk (PR #137)\\n\\n### Added\\n- Add and expose
        function `set_logging_handler` to configure a specific StreamHandler from
        [@nmaynes](https://github.com/nmaynes) (PR #135)\\n- Add `CHANGELOG.md` entries,
        format is based on [Keep a Changelog](https://keepachangelog.com/en/1.0.0/)
        (PR #141)\\n\\n## [2.0.7](https://github.com/Ousret/charset_normalizer/compare/2.0.6...2.0.7)
        (2021-10-11)\\n### Added\\n- Add support for Kazakh (Cyrillic) language detection
        (PR #109)\\n\\n### Changed\\n- Further, improve inferring the language from
        a given single-byte code page (PR #112)\\n- Vainly trying to leverage PEP263
        when PEP3120 is not supported (PR #116)\\n- Refactoring for potential performance
        improvements in loops from [@adbar](https://github.com/adbar) (PR #113)\\n-
        Various detection improvement (MD+CD) (PR #117)\\n\\n### Removed\\n- Remove
        redundant logging entry about detected language(s) (PR #115)\\n\\n### Fixed\\n-
        Fix a minor inconsistency between Python 3.5 and other versions regarding
        language detection (PR #117 #102)\\n\\n## [2.0.6](https://github.com/Ousret/charset_normalizer/compare/2.0.5...2.0.6)
        (2021-09-18)\\n### Fixed\\n- Unforeseen regression with the loss of the backward-compatibility
        with some older minor of Python 3.5.x (PR #100)\\n- Fix CLI crash when using
        --minimal output in certain cases (PR #103)\\n\\n### Changed\\n- Minor improvement
        to the detection efficiency (less than 1%) (PR #106 #101)\\n\\n## [2.0.5](https://github.com/Ousret/charset_normalizer/compare/2.0.4...2.0.5)
        (2021-09-14)\\n### Changed\\n- The project now comply with: flake8, mypy,
        isort and black to ensure a better overall quality (PR #81)\\n- The BC-support
        with v1.x was improved, the old staticmethods are restored (PR #82)\\n- The
        Unicode detection is slightly improved (PR #93)\\n- Add syntax sugar \\\\_\\\\_bool\\\\_\\\\_
        for results CharsetMatches list-container (PR #91)\\n\\n### Removed\\n- The
        project no longer raise warning on tiny content given for detection, will
        be simply logged as warning instead (PR #92)\\n\\n### Fixed\\n- In some rare
        case, the chunks extractor could cut in the middle of a multi-byte character
        and could mislead the mess detection (PR #95)\\n- Some rare 'space' characters
        could trip up the UnprintablePlugin/Mess detection (PR #96)\\n- The MANIFEST.in
        was not exhaustive (PR #78)\\n\\n## [2.0.4](https://github.com/Ousret/charset_normalizer/compare/2.0.3...2.0.4)
        (2021-07-30)\\n### Fixed\\n- The CLI no longer raise an unexpected exception
        when no encoding has been found (PR #70)\\n- Fix accessing the 'alphabets'
        property when the payload contains surrogate characters (PR #68)\\n- The logger
