        (PR #69 #76)\\n- Allow fallback on specified encoding if any (PR #71)\\n\\n##
        [2.0.3](https://github.com/Ousret/charset_normalizer/compare/2.0.2...2.0.3)
        (2021-07-16)\\n### Changed\\n- Part of the detection mechanism has been improved
        to be less sensitive, resulting in more accurate detection results. Especially
        ASCII. (PR #63)\\n- According to the community wishes, the detection will
        fall back on ASCII or UTF-8 in a last-resort case. (PR #64)\\n\\n## [2.0.2](https://github.com/Ousret/charset_normalizer/compare/2.0.1...2.0.2)
        (2021-07-15)\\n### Fixed\\n- Empty/Too small JSON payload miss-detection fixed.
        Report from [@tseaver](https://github.com/tseaver) (PR #59)\\n\\n### Changed\\n-
        Don't inject unicodedata2 into sys.modules from [@akx](https://github.com/akx)
        (PR #57)\\n\\n## [2.0.1](https://github.com/Ousret/charset_normalizer/compare/2.0.0...2.0.1)
        (2021-07-13)\\n### Fixed\\n- Make it work where there isn't a filesystem available,
        dropping assets frequencies.json. Report from [@sethmlarson](https://github.com/sethmlarson).
        (PR #55)\\n- Using explain=False permanently disable the verbose output in
        the current runtime (PR #47)\\n- One log entry (language target preemptive)
        was not show in logs when using explain=True (PR #47)\\n- Fix undesired exception
        (ValueError) on getitem of instance CharsetMatches (PR #52)\\n\\n### Changed\\n-
        Public function normalize default args values were not aligned with from_bytes
        (PR #53)\\n\\n### Added\\n- You may now use charset aliases in cp_isolation
        and cp_exclusion arguments (PR #47)\\n\\n## [2.0.0](https://github.com/Ousret/charset_normalizer/compare/1.4.1...2.0.0)
        (2021-07-02)\\n### Changed\\n- 4x to 5 times faster than the previous 1.4.0
        release. At least 2x faster than Chardet.\\n- Accent has been made on UTF-8
        detection, should perform rather instantaneous.\\n- The backward compatibility
        with Chardet has been greatly improved. The legacy detect function returns
        an identical charset name whenever possible.\\n- The detection mechanism has
        been slightly improved, now Turkish content is detected correctly (most of
        the time)\\n- The program has been rewritten to ease the readability and maintainability.
        (+Using static typing)+\\n- utf_7 detection has been reinstated.\\n\\n###
        Removed\\n- This package no longer require anything when used with Python
        3.5 (Dropped cached_property)\\n- Removed support for these languages: Catalan,
        Esperanto, Kazakh, Baque, Volap\xFCk, Azeri, Galician, Nynorsk, Macedonian,
        and Serbocroatian.\\n- The exception hook on UnicodeDecodeError has been removed.\\n\\n###
        Deprecated\\n- Methods coherence_non_latin, w_counter, chaos_secondary_pass
        of the class CharsetMatch are now deprecated and scheduled for removal in
        v3.0\\n\\n### Fixed\\n- The CLI output used the relative path of the file(s).
        Should be absolute.\\n\\n## [1.4.1](https://github.com/Ousret/charset_normalizer/compare/1.4.0...1.4.1)
        (2021-05-28)\\n### Fixed\\n- Logger configuration/usage no longer conflict
        with others (PR #44)\\n\\n## [1.4.0](https://github.com/Ousret/charset_normalizer/compare/1.3.9...1.4.0)
        (2021-05-21)\\n### Removed\\n- Using standard logging instead of using the
        package loguru.\\n- Dropping nose test framework in favor of the maintained
        pytest.\\n- Choose to not use dragonmapper package to help with gibberish
        Chinese/CJK text.\\n- Require cached_property only for Python 3.5 due to constraint.
        Dropping for every other interpreter version.\\n- Stop support for UTF-7 that
        does not contain a SIG.\\n- Dropping PrettyTable, replaced with pure JSON
        output in CLI.\\n\\n### Fixed\\n- BOM marker in a CharsetNormalizerMatch instance
        could be False in rare cases even if obviously present. Due to the sub-match
        factoring process.\\n- Not searching properly for the BOM when trying utf32/16
        parent codec.\\n\\n### Changed\\n- Improving the package final size by compressing
        frequencies.json.\\n- Huge improvement over the larges payload.\\n\\n### Added\\n-
        CLI now produces JSON consumable output.\\n- Return ASCII if given sequences
        fit. Given reasonable confidence.\\n\\n## [1.3.9](https://github.com/Ousret/charset_normalizer/compare/1.3.8...1.3.9)
        (2021-05-13)\\n\\n### Fixed\\n- In some very rare cases, you may end up getting
        encode/decode errors due to a bad bytes payload (PR #40)\\n\\n## [1.3.8](https://github.com/Ousret/charset_normalizer/compare/1.3.7...1.3.8)
        (2021-05-12)\\n\\n### Fixed\\n- Empty given payload for detection may cause
        an exception if trying to access the `alphabets` property. (PR #39)\\n\\n##
        [1.3.7](https://github.com/Ousret/charset_normalizer/compare/1.3.6...1.3.7)
        (2021-05-12)\\n\\n### Fixed\\n- The legacy detect function should return UTF-8-SIG
        if sig is present in the payload. (PR #38)\\n\\n## [1.3.6](https://github.com/Ousret/charset_normalizer/compare/1.3.5...1.3.6)
        (2021-02-09)\\n\\n### Changed\\n- Amend the previous release to allow prettytable
        2.0 (PR #35)\\n\\n## [1.3.5](https://github.com/Ousret/charset_normalizer/compare/1.3.4...1.3.5)
        (2021-02-08)\\n\\n### Fixed\\n- Fix error while using the package with a python
        pre-release interpreter (PR #33)\\n\\n### Changed\\n- Dependencies refactoring,
